import { Component } from '@angular/core';

import { faInstagram, faLinkedin, faGithub, faTwitter } from '@fortawesome/free-brands-svg-icons';
import { faEnvelope } from '@fortawesome/free-regular-svg-icons';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'updated-portfolio';
  faInstagram = faInstagram;
  faLinkedin = faLinkedin;
  faGithub = faGithub;
  faTwitter = faTwitter;
  faEnvelope = faEnvelope;
}
<div class="pageBox">
  <div class="titleBox">
    <img src="assets/me.jpeg" class="myPhoto" />
    <h1 class="myName">Ethan R. McDowell</h1>
  </div>
  <div class="socialBox">
    <a href="">
      <fa-icon [icon]="faInstagram" size="2x" class="fa-icon"></fa-icon>
    </a>
    <a href="">
      <fa-icon [icon]="faLinkedin" size="2x" class="fa-icon"></fa-icon>
    </a>
    <a href="">
      <fa-icon [icon]="faGithub" size="2x" class="fa-icon"></fa-icon>
    </a>
    <a href="">
      <fa-icon [icon]="faTwitter" size="2x" class="fa-icon"></fa-icon>
    </a>
    <a href="">
      <fa-icon [icon]="faEnvelope" size="2x" class="fa-icon"></fa-icon>
    </a>
  </div>
  <hr />
  <div class="aboutBox">
    <p>
      Hi, I'm Ethan! I'm a full-stack web developer located in Detroit,
      Michigan.
    </p>
  </div>
</div>
